  false,\n\t\"url\": null,\n\t\"notes\": \"Routes represent a single linear feature,
  such as a city street or highway. Routes are linear features composed of one or
  more arcs or parts of an arc; for example, a highway may be composed of a number
  of connected arcs. A route, for linear referencing purposes, is simply a linear
  feature with measure values attached to it. Each route, at minimum, has an associated
  measurement system consisting of a route identifier, a measurement value along the
  route. The measures are used to locate data that describe parts of the route. Event
  data can represent point or range data. Point events are locations (an accident,
  a sign, or a culvert) somewhere along a route at a single measure (log mile, mile
  post). Linear or range events (functional classification, pavement condition, pavement
  type) extend along a route that starts at a measure and ends at another measure.\",\n\t\"license_title\":
